import { useSelector } from "../../CustomStore/hooks/useSelector"

export const Cart = () => {
  const cart = useSelector((state) => console.log(state,"") || {});
  console.log(cart);

  return (
    <div>
      <div>Cart</div>
      <div>
      {Object.keys(cart).map((key) => (
        <div>
          <span>{key}</span>
          <span>{cart[key]}</span>
        </div>
      ))}
      </div>
    </div>
  )
}
